import React from 'react';
import { Link } from "react-router-dom";
const watch = () => {
    return (
        <div className='video1'>
            <iframe width="900" height="450" src="https://www.youtube.com/watch?v=N14_XNH8Mqs" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
            <ul className='vid-ul'>
                <Link to="/watchQuiz1" ><button className="vid-start-button">Start Quiz</button></Link>
            </ul>


        </div>

    );
}

export default watch;
